import React from 'react'
import "./card.css"
import {MoreHorizontal} from "react-feather";
import {Labels} from '../Labels/Labels';
import {Clock, CheckSquare} from "react-feather";

export const Card = ()=> {
  
    return (
      <div className='card'>
        <div className='card_title'>
            <div className='card_labels'>
              <Labels text = "FrontEnd" color = "blue" />
              {/* <Labels close text = "BackEnd" color = "red" /> */}
            </div>
            <MoreHorizontal />
        </div>
        <div className="card_main_title">
             do the board
        </div>
        <div className="card_footer">
          <p><Clock /></p>
          <p><CheckSquare /> </p>
        </div>
      </div>
    );
  
}
